        "comments": "Studier\u00e5dets kommentarerStudenter efterfr\u00e5gade b\u00e4ttre schemal\u00e4ggning f\u00f6r projektet, vilket kommer l\u00f6sa sig i och med ny terminsplan.Tidigare presentation av tentan samt m\u00e4ngden material som kursen inneh\u00e5ller kommer f\u00f6rhoppningsvis leda till b\u00e4ttre f\u00f6rst\u00e5else f\u00f6r hur kursen \u00e4r upplagd och vad man ska kunna.Det f\u00f6rekom mycket klagom\u00e5l p\u00e5 presentationerna, de kommer g\u00f6ras om till n\u00e4sta \u00e5r.Kursl\u00e4rarens kommentererA pity that so few (55%) of the students bothered to fill in the CEQ-questionnaire. From my own questionnaire (that focus on other aspects than the CEQ) I got an almost 90% response rate and generally a more favourable/positive evaluation:http://fileadmin.cs.lth.se/cs/Education/EDAN10/EvalResults.pdfAs always appropriate workload gets a negative evaluation. As always I take that as some students' subjective impression rather than hard facts. On the course web-page it is detailled how much time I expect/assume the student to work with every aspect of the course - and no-one has told/shown me that I am too optimistic. Some students even say that they don't put in as much time as the course is supposed to take - which is also the result I got when I made a more in-depth investigation of the students' real workload 4-5 years ago.Student presentations continue to be a problem - students appreciate to get the practice of doing a presentation, but don't think the quality is high enough to get anything from listening to. I have tried to find ways to better support the groups in creating better presentations, but with little result. This year I did an experiment with substituting some student presentation with short video-introduction done by the lecturer. This should support the subsequent reading of the course material and leave more time for discussions at the following lecture. The experiment was rather successful and will next year (with some minor changes) substitute the student presentations.Some students apparently don't read the information they are given and/or don't listen to information given at the lectures (or are absent?). It should come as no surprise that there is a lot to read on this course - it is one of the course objectives. It should not be a surprise how an oral exam in group will be - at the last lecture there is a 45-minute role-play that shows how it is conducted and gives examples of the types of questions that will be asked. It is also said from the first lecture on, that the best way to prepare for the exam is to be active at the exercise sessions since they will be very similar to the exam situation. It is, however, a serious problem at the exam if the co-examiner transmit a feeling of dis-interest in the exam situation (as is apparently happened with one group). This is not acceptable and could cause some students to become even more nervous in what they feel is a stressful situation - we will make sure that this never happens again. I don't understand how students can claim that the project has to be done \"over Christmas\" - I have stated (and said several times) that I do not want students to work during their Christmas holiday, but that the CSN want them to work for two weeks in January. I will try to see if there are some things I can be more clear about, but I refuse to have to \"shove everything down the throat\" of the students - I expect *university* students to be active and take responsibility for their own learning.I will continue the work on the exercises. Some students hate the metaphors, others love them - so they will stay;-) However, I will add even more \"normal\" exercises to give more variety and try to see if I can come up with a \"running exercise\" that the groups could spend at little time on at each exercise session (and might be a obligatory hand-in at the end). The lab work will also be extended, maybe one more lab but definitely with more elaborate lab reports. Adding more work on exercises and labs, will allow me to scale down the size of the project - and together with the reading period changes have the project finished and handed in before Christmas and before the exam.In another course that I am responsible for (Coaching of agile teams), I have experimented a little with the concept of student peer assessment (kamratgranskning). Though students on the CM course are generally satisfied with the feedback they get, it is very heavy on resources. I have been trying to find a way to provide more feedback and \"discussion\" without it being too costly for the department to pay - and I believe that student peer assessment might be the way to go if used more systematically. So I will launch into an experiment to see to what extreme I can take student peer assessment on the CM course next year.CEQ-enk\u00e4ten fylldes iWebbenk\u00e4ter har anv\u00e4nts p\u00e5 denna kurs."
