        "comments": "Kursrepresentantens kommentarerAngel\u00e4gen kurs f\u00f6r E studenter.Inf\u00f6r n\u00e4sta \u00e5r kommer kursen g\u00f6ras om en aning. Fler check Points ska inf\u00f6ras f\u00f6r att studenterna ska ligga mer i fas, och slippa stressen som kan uppkomma om man hamnar f\u00f6r l\u00e5ngt efter. Efter synpunkter fr\u00e5n f\u00f6rra \u00e5ret g\u00e4llande sv\u00e5righetsgraden av det individuella projektet, har nu nya tider f\u00f6r genomg\u00e5ng och \u00f6vningar inf\u00f6r projektet planerats.\u00c4ven laborations utrustningen kommer byggas om inf\u00f6r n\u00e4sta kursstart f\u00f6r att underl\u00e4tta f\u00f6r studenterna.CEQ-enk\u00e4ten kommer att bli aningen mer uppdelad s\u00e5 att studenterna kan bed\u00f6ma b\u00e5de det individuella projektet och industriprojektet.Bygga ett forum wiki f\u00f6r kursen som studenterna sj\u00e4lv f\u00e5r ha hand om \u00e4r under \u00e4ven planerat.Kursl\u00e4rarens kommentererThe course Applied Mechatronics has students from four different engineering programmes: this year 35 from electrical and 13 from mechanical engineering, 3 from engineering physics and 1 from computer science. The variation in prerequisites is great, which is an obvious asset in mechatronic team work, but also a challenge when it comes to instructing a microprocessor project.The course has two parts, one individual lab oriented electronic design assignment and one mechatronic team project where a concept study is made at an industrial company.20 students have given course evaluations. Below are listed the main aspects that were presented in the course evaluations and the meeting with a student representative.Individual project:\u0095 The system with checkpoints has worked well. We will introduce another checkpoint on motor velocity measurement next year. We will also speed up the recommended pace during the first period and advise the students to do the first checkpoints in a shorter time.\u0095 Heavy workload esp. with the C-programming\u0096 but it was worth it because it was interesting and instructive.\u0095 The cooperation between students worked well. We are considering to set up a wiki, an internet forum to collect tips and advice.\u0095 Next year we will introduce lessons with examples to learn from on e g interrupts and PWM, where theory and hands-on moments in the lab are alternated.\u0095 The velocity sensor will be replaced with a better one. There will also be a display for velocity mounted.\u0095 Serious, advanced and inspiring project\u0095 More information which structures the project with all circuit boards etc in the beginning. Comment: The character of the studies is that the students shall seek information and knowledge from data sheets etc. on their own in order to understand the system work more deeply. Therefore, more information that structures the project in the beginning will not be offered.Group project:\u0095 Difficult to evaluate both the individual and the group project in one CEQ. Next year we will ask extra questions on the group project and let the CEQ evaluate the individual project.\u0095 Good with a project in a real company.\u0095 Group project unnecessary. Comment: We find that the two projects complement each other and together make a good overview of mechatronic work. \u0095 Instructive and fruitful with industry contactWe note that the midterm checkpoint worked well. We will probably add another checkpoint for security next year.Finally, we would like to express that we had a really good time during the course and really appreciated the cooperation with the students as well as their diligence and seriousness.Fran, Gabriel, Henriette, Gunnar, Robert and SvenCEQ-enk\u00e4ten fylldes iWebbenk\u00e4ter har anv\u00e4nts p\u00e5 denna kurs."
