        "comments": "Kursrepresentantens kommentarerKommentarer har ej inkommet f\u00f6re utsatt tidKursl\u00e4rarens kommentererThe course is rather broad and addresses both hardware design and software development for embedded systems. It also puts together students' knowledge from both areas. The lectures are supposed to address main topics of the embedded system design while labs are illustration for this in a very small scale. This scale is enforced by the time limits on labs. Bigger designs can be tried on the continuation course EDA385.Students often complain that the time at lab is limited and they have problem to complete lab assignments.  The problem is also availability of Xilinx boards during lab time only. There is several aspects of this. First, as it was pointed out to students, the labs require preparations, i.e. reading of the instruction, preparation for a specific assignment and writing C or VHDL code in advance. Second, many parts of development does not require boards. Of course, the board is finally the bottleneck. To solve this we will consider to introduce so called \"unsupervised\" lab occasions in addition to ordinary supervised labs. During unsupervised labs the students will have access to the board. Alternatively, we consider to provide access to the computer with the connected Xilinx board through internet (this requires some development). Of course, they can make development outside lab time as well. Students pointed out that labs seems to have little connection to the lectures. While lectures discuss the general design problems, the labs are supposed to illustrate some of them. We plan to add additional discussion in the second lecture where this connection will be emphasized. Moreover, we plan to add additional presentation of FPGA technology during one of the lectures to improve understanding of this technology for students with more software background. Finally, in the lecture on interfacing we plan to add discussion on interfacing methods used in lab FPGA hardware. This hopefully, will make a better connection between lectures and labs and will motivate lab assignments.Some restructuring of the lectures is also planned. We plan, for example, to extend/replace some material with the new material on multi- and many-core systems connected with NoC (Network on Chip). This will give a better insight into newest technologies.CEQ-enk\u00e4ten fylldes iWebbenk\u00e4ter har anv\u00e4nts p\u00e5 denna kurs."
